import { ReactNode } from 'react';
import { Link, useNavigate, useLocation } from 'react-router-dom';
import { Database, LogOut, Menu, X, Search } from 'lucide-react';
import { useState } from 'react';
import { authAPI } from '../services/api';
import toast from 'react-hot-toast';

interface LayoutProps {
  children: ReactNode;
}

const Layout = ({ children }: LayoutProps) => {
  const [sidebarOpen, setSidebarOpen] = useState(false);
  const navigate = useNavigate();
  const location = useLocation();

  const handleLogout = async () => {
    try {
      await authAPI.logout();
      toast.success('Logged out successfully');
      navigate('/login');
    } catch (error) {
      toast.error('Error logging out');
    }
  };

  return (
    <div className="min-h-screen bg-gray-100">
      {/* Sidebar */}
      <div
        className={`fixed inset-y-0 left-0 z-50 w-64 bg-gray-900 shadow-lg transform ${
          sidebarOpen ? 'translate-x-0' : '-translate-x-full'
        } transition-transform duration-300 ease-in-out lg:translate-x-0 lg:static lg:inset-0`}
      >
        <div className="flex items-center justify-between h-16 px-6 border-b border-gray-700 bg-black">
          <Link to="/" className="flex items-center space-x-2">
            <Database className="h-8 w-8 text-white" />
            <span className="text-xl font-bold text-white">DBSee</span>
          </Link>
          <button
            onClick={() => setSidebarOpen(false)}
            className="lg:hidden p-2 rounded-md text-gray-400 hover:text-gray-500"
          >
            <X className="h-6 w-6" />
          </button>
        </div>

        <div className="flex flex-col h-full">
          <nav className="mt-6 px-3 flex-1">
            <div className="space-y-3">
              <Link
                to="/"
                className={`flex items-center px-4 py-4 text-base font-medium rounded-lg transition-all duration-200 block w-full ${
                  location.pathname === '/' 
                    ? 'bg-black text-white shadow-lg border border-gray-600' 
                    : 'text-gray-300 hover:bg-gray-800 hover:text-white'
                }`}
              >
                <Database className="mr-3 h-6 w-6" />
                Tabelle
              </Link>
              <Link
                to="/search"
                className={`flex items-center px-4 py-4 text-base font-medium rounded-lg transition-all duration-200 block w-full ${
                  location.pathname === '/search' 
                    ? 'bg-black text-white shadow-lg border border-gray-600' 
                    : 'text-gray-300 hover:bg-gray-800 hover:text-white'
                }`}
              >
                <Search className="mr-3 h-6 w-6" />
                Ricerca CIG
              </Link>
            </div>
          </nav>

          <div className="px-3 py-4 border-t border-gray-700 mt-auto">
            <button
              onClick={handleLogout}
              className="flex items-center w-full px-4 py-4 text-base font-medium text-gray-300 rounded-lg hover:bg-gray-800 hover:text-red-400 transition-all duration-200"
            >
              <LogOut className="mr-3 h-6 w-6" />
              Logout
            </button>
          </div>
        </div>


      </div>

      {/* Main content */}
      <div className="lg:pl-64">
        {/* Top navigation */}
        <div className="sticky top-0 z-40 bg-gray-900 border-b border-gray-700 lg:hidden">
          <div className="flex items-center justify-between h-16 px-4">
            <button
              onClick={() => setSidebarOpen(true)}
              className="p-2 rounded-md text-gray-300 hover:text-white"
            >
              <Menu className="h-6 w-6" />
            </button>
            <Link to="/" className="flex items-center space-x-2">
              <Database className="h-6 w-6 text-white" />
              <span className="text-lg font-bold text-white">DBSee</span>
            </Link>
            <div className="w-10"></div>
          </div>
        </div>

        {/* Page content */}
        <main className="p-6">
          {children}
        </main>
      </div>

      {/* Sidebar overlay for mobile */}
      {sidebarOpen && (
        <div
          className="fixed inset-0 z-40 bg-gray-600 bg-opacity-75 lg:hidden"
          onClick={() => setSidebarOpen(false)}
        />
      )}
    </div>
  );
};

export default Layout;
